import React from 'react';
import './Header.css';
import {Link} from 'react-router-dom';

function Header() {
    return (
        <div className={
        'container center f3 ma0 pa2 bb bw2 br1 black'}>
            <h1 className='yellow code underline'>TodoList</h1>

            {/* Home and About */}
            <div>
                <Link className='yellow f3 pill
                ' to=''>Home </Link> -
                <Link className='yellow f3' to='/about'> About</Link>
            </div>

        </div>
    )
}

export default Header
